const ignoredRuneInPrefixSet = `"‘’“”$\'-(`

func dataTree() *dataNode {
	return buildDataTreeFromRaw(raw)
}

var buildDataOnce sync.Once

func buildDataTreeFromRaw(raw string) *dataNode {
	buildDataOnce.Do(func() {
		var n *dataNode
		err := json.Unmarshal(s2b(raw), &n)
		if err != nil {
			panic("impossible to unmarshal raw")
		}
		dataRoot = n
	})
	return dataRoot
}

func (n *dataNode) UnmarshalJSON(bytes []byte) error {
	var m map[string]interface{}
	err := json.Unmarshal(bytes, &m)
	if err != nil {
		return err
	}
	nn, err := rawMapToNode(m)
	if err != nil {
		return err
	}
	n.Article = nn.Article
	n.Next = nn.Next
	return nil
}

func rawMapToNode(m map[string]interface{}) (*dataNode, error) {
	var n dataNode
	if len(m) > 1 {
		n.Next = map[rune]*dataNode{}
	}
	for k, v := range m {
		if k == "article" {
			n.Article = s2a(v.(string))
		} else {
			nm, isMap := v.(map[string]interface{})
			if !isMap {
				return nil, fmt.Errorf("is not map")
			}
			nn, err := rawMapToNode(nm)
			if err != nil {
				return nil, err
			}
			r, _ := utf8.DecodeRuneInString(k)
			n.Next[r] = nn
		}
	}
	return &n, nil
}

// s2a converts a string to its article equivalent.
func s2a(s string) article {
	switch s {
	case "a":
		return a
	case "an":
		return an
	default:
		panic(fmt.Sprintf("invalid string %s", s))
	}
}

// a2s converts an article to its string representation.
func a2s(article article) string {
	switch {
	case a == article:
		return "a"

	case an == article:
		return "an"
	default:
		panic("invalid article")
	}
}

// s2b converts string to a byte slice without memory allocation.
//
// Note it may break if string and/or slice header will change
// in the future go versions.
//
// gsempe:
// Code directly copied from fasthttp https://github.com/valyala/fasthttp/blob/f6aac906c86613d36ecfc0cdaafee8b868cdbe60/bytesconv.go#L330-L343
// See the following article for in depth explanation https://www.sobyte.net/post/2022-01/go-string-bytes/
func s2b(s string) (b []byte) {
	/* #nosec G103 */
	bh := (*reflect.SliceHeader)(unsafe.Pointer(&b))
	/* #nosec G103 */
	sh := (*reflect.StringHeader)(unsafe.Pointer(&s))
	bh.Data = sh.Data
	bh.Cap = sh.Len
	bh.Len = sh.Len
	return b
}
